INSERT INTO `email_template` VALUES (1,'Password Reset Email','Restablecimiento de contraseña exitoso','<p><span [removed]=\"font-weight: bold;\">Hola [[to]],</span></p><p><span [removed]=\"font-weight: bold;\">Recientemente solicitó una nueva contraseña. Recibimos la solicitud y su contraseña ha sido modificada.</span></p><p><span [removed]=\"font-weight: bold;\">Tipo de cuenta : [[account_type]]<br></span></p><p><span [removed]=\"font-weight: bold;\">Nueva contraseña : [[password]]</span></p><p><span [removed]=\"font-weight: bold;\">Gracias,</span></p><p><span [removed]=\"\" bold;\"=\"\">[[from]]</span></p>'),(2,'Account Approval Email','Estado de aprobación de la cuenta','<p><span [removed]=\"font-weight: bold;\">Hola [[to]],</span></p><p><span [removed]=\"font-weight: bold;\">Tipo de cuenta : [[account_type]]</span></p><p><span [removed]=\"font-weight: bold;\">Correo : [[email]]</span></p><p>Gracias por registrarse en nuestro sitio. Su registro debe ser aprobado por el administrador y su cuenta ha sido [[status]]. Póngase en contacto con nuestro equipo de soporte si tiene más preguntas. </p><p>Los mejores deseos.<br></p><p><span [removed]=\"font-weight: bold;\"><br></span></p><p><span [removed]=\"font-weight: bold;\">Gracias,</span></p><p><span [removed]=\"\" bold;\"=\"\">[[from]]</span></p>'),(3,'Membership Upgrade Email','Membresía actualizada','<p><span [removed]=\"font-weight: bold;\">Hola [[to]],</span></p><p><span [removed]=\"font-weight: bold;\">Tipo de cuenta : [[account_type]]</span></p><p><span [removed]=\"font-weight: bold;\">Correo : [[email]]</span></p><p><span [removed]=\"font-weight: bold;\">Tipo de membrecia [[package]]. </span></p><p>Comuníquese con el equipo de administrador si tiene más preguntas. Los mejores deseos.<br></p><p><span [removed]=\"font-weight: bold;\"><br></span></p><p><span [removed]=\"font-weight: bold;\">Gracias,</span></p><p><span [removed]=\"\" bold;\"=\"\">[[from]]</span></p>'),(4,'Vendors Account Opening','Apertura de cuen